import React from "react";
import { BrowserRouter, Routes as Router, Route } from "react-router-dom";

import { Notas } from "./components/Notas";

export const Routes = () => {
    return (
        <Router>
            <Route path="/notas" component={Notas} />
        </Router>
    )
};
